description:
Four sexually charged young woman have a fascination with older, mentoring, father-figure types. Presley Hart is attracted to her charming, sensitive Literature Professor; Jessa Rhodes succumbs to the charms of a charismatic political candidate. Natalia Starr is a rich, spoiled girl who finds a sensual friendship with the family chauffeur; and Vanessa Cage is a singer who makes amends after a cantankerous rock star kicked her out of his band.

